import numpy as np
import matplotlib.pyplot as plt
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense
from tensorflow.keras.optimizers import Adam
from sklearn.datasets import load_iris
from sklearn.model_selection import train_test_split
from sklearn.preprocessing import OneHotEncoder

iris = load_iris()
print(type(iris))
print('Data shape', iris.data.shape)    #행렬
print('Label', iris.target.shape)       #
print(iris)

import pandas as pd
iris_df = pd.DataFrame(iris.data, columns=iris.feature_names)
pd.plotting.scatter_matrix(iris_df, c=iris.target, figsize=(7, 7), marker='*', hist_kwds={'bins': 20}, s=60, alpha=0.8)
plt.show()

iris_df.info()

x=iris.data
y=iris.target.reshape(-1,1)     #encoder에게 값 줄때는 리스트와 같은 형태가 되야해서 reshape을 이용해 묶어줌.
y.shape

encoder = OneHotEncoder(sparse=False)       #sparse는 희소행렬을 쓸건지 안쓸건지임
encoded_y = encoder.fit_transform(y)
print(encoded_y.shape)
print(encoded_y[:5])    #3개씩 묶어줌.

"""다중 분류기 즉 출력을 여러개 할 때는 onehotencoder 형태로 줘야함.

데이터프레임을 가지고 있을 때 pandas안에있는 getdummies로 onehotencoding 하면됨.

또는 from sklearn.preprocessing import OneHotEncoder 이렇게 쓰면됨

희소행렬은 행렬값이 1개 또는 몇개정도만 값이있고 나머지 모든값이 0인 행렬임. 희소행렬 표현법 sparse [2,1] 1.0 2행1열에 1이 있다.


"""

x_train, x_test, y_train, y_test = train_test_split(x, encoded_y, test_size=0.2)
print(x_train.shape, y_train.shape)
print(x_test.shape, y_test.shape)

model = Sequential()
model.add(Dense(256, input_dim=4, activation='relu'))
model.add(Dense(128, activation='relu'))
model.add(Dense(512, activation='relu'))
model.add(Dense(3, activation='softmax'))
model.summary()

""""Iris dataset"은 머신러닝에서 많이 사용되는 분류 문제를 다루기 위한 대표적인 데이터셋 중 하나입니다. 이 데이터셋은 통계학자 Ronald A. Fisher에 의해 소개되었습니다. 아이리스 데이터셋은 세 가지 품종의 붓꽃(세토사, 버시컬러, 버지니카)에서 각각 50개의 측정값을 가지고 있습니다.

첫번째 출력이 1이면 세토사이고 0이면 세토사아닌거임
이런식으로 세토사아니면 버시컬러 아니면 버지니카니까 100 010 001 이런식으로 출력이 나와야함.

![image.png](data:image/png;base64,)
"""

opt = Adam(lr=0.001)            #아담 객체를 만들어줌 lr 이거는 러닝레이트임 즉 러닝레이트 설정해주려고 아담객체 만들어준거임. 근데 아담은 이게 필요없긴함.
#아담은 알아서 러닝레이트인 스탭사이즈를 알아서 조절해줘서 알아서 발산하는걸 막음 여기서 그냥 러닝레이트 조절하는법 보려고 한거임.
model.compile(opt, loss='categorical_crossentropy', metrics='accuracy') #mse는 회귀모델에서 예측할때 사용하거 binary_crossentropy는 ~~ 여기서는 categorical_crossentropy씀
fit_hist = model.fit(x_train, y_train, batch_size=5, epochs=30, verbose=1)

"""Binary Crossentropy (이진 교차 엔트로피):

이진 분류 문제에서 사용되며, 출력이 하나의 이진 값일 때 주로 선택됩니다.
출력이 확률로 나타나는 경우에 사용됩니다.

-----------

Categorical Crossentropy (다중 클래스 교차 엔트로피):

다중 클래스 분류 문제에서 사용되며, 출력이 여러 개의 클래스에 대한 확률 분포일 때 주로 선택됩니다.
출력이 각 클래스에 대한 확률로 나타날 때 사용됩니다.
"""

score = model.evaluate(x_test, y_test, verbose=0)
print('Final test set accuracy :',score[1])

plt.plot(fit_hist.history['accuracy'])
plt.show()

labels = iris.target_names
labels

my_sample = np.random.randint(30)
sample = x_test[my_sample]
print('sample data', sample)
sample = sample.reshape(1,4)    #4개씩 묶어준거임.
print('reshaped data',sample)
pred = model.predict(sample)
print('pred is',pred)
print('actual is ',y_test[my_sample])
print('Target :', labels[np.argmax(y_test[my_sample])]) #argmax는 가장 큰 값의 인덱스를 반환함
print('Prediction after learning is :', labels[np.argmax(pred)])

